import React from "react";
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom"; 

function makeLIs(root, lis) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <li key={i}>
      <Link to={`${root}/${li.name}`}>{li.name}</Link>
      </li>
    );
  });
  return elements;
}

export const LinkList = ({root, lis}) => {
  <ul>
    <p>hi</p>
    {makeLIs(root, lis)}
  </ul>
}
